// Navbar.jsx

import React from 'react';
import { Link } from 'react-router-dom';
import '../Components/components.css'

const Navbar = () => {
  return (
    <nav>
      <h2>DH Odonto</h2>
      <Link to="/">Home</Link>
      <Link to="/favs">Favs</Link>
      <Link to="/contact">Contact</Link>
    </nav>
  );
};

export default Navbar;
